export const initialState = [
  { item: "Learn about reducers", completed: false, id: Date.now() }
];

export const todoReducer = (state, action) => {
  switch (action.type) {
    case "ADD_TODO":
      return {
        ...state,
        item: "Hello",
        completed: false,
        id: Date.now()
      };

    default:
      return state;
  }
};
